const initialState = {
  data: {},
};
const reducer = (state = initialState, action) => {
  switch (action.type) {
    case "SET_LOGED_IN_USER_DATA":
      return {
        ...state,
        data: action.userData.data,
      };
    case "LOGGED_OUT":
      return {
        ...state,
        data: {},
      };
    default:
      return { ...state };
  }
};
export default reducer;
